measurements.description:
Twenty-five flowers and three buds on ten inflorescences;
	sepals light green, heavily striated burgundy;
	petals light green, lightly striated burgundy, heavily marked at base;
	lip cream, lightly marked scarlet, mid lobe recurved; pollen cap cream;
	substance firm; texture matte; also awarded a CCM of 85 points, award 20194859; awarded as Cymbidium tortisepalum;
	SITF has determined, with the help of Ken Jacobsen that this is the natural hybrid x nishiuchianum (goeringii x kanran),
	based on the leaf articulation and the sub equal or shorter inflorescences (May 2019).
